import './App.css';
import { GroceryList } from './GroceryList';
import image1 from './man.jpg'



function App() {
  return (
    <div className="App">
      <img src={image1} alt='man' width="250px"/>
      <GroceryList/>
    </div>
  );
}

export default App;
